options = VarParsing ('analysis')

options.maxEvents = 1000000
options.inputFiles = ["root://eoscms//eos/cms/store/data/Run2022G/EphemeralHLTPhysics0/MINIAOD/PromptReco-v1/000/362/439/00000/08487157-d3f6-42c2-9030-670a283fcd83.root"]
